import React, { useState} from "react";
import PhoneInput from "../atoms/phoneInput";
import SendButton from "../atoms/sendButton";
import CodeInput from "../atoms/codeInput";
import ConfirmButton from "../atoms/confirmButton";

export interface CertiProps{
    cell : string,
    code : string,
    setInfo : React.Dispatch<React.SetStateAction<CertiProps>>
}

const CertiFormGroup = () => {
    const [cell, setCell] = useState<string>('');
    const [code, setCode] = useState<string>('');
    const [info, setInfo] = useState<CertiProps>();
    return (
        <div className='mx-2 my-4'>
            <div className='flex justify-between '>
                <PhoneInput setCell={setInfo}/>
                <SendButton cell={cell} />
            </div>
            <div className='flex justify-between mt-4'>
                <CodeInput/>
                <ConfirmButton/>
            </div>
        </div>
    )
}
export default CertiFormGroup;
